import customer from '../images/customer.png';
const CustomerLogin = ()=>{
    return (
<div className="border container p-0"  style={{display: 'flex',  justifyContent:'center'}}>

    <img src={customer} alt="customer missing" className="rounded mx-auto d-block ml-10 mr-10 flex-left" height="400px"></img>
    <form className='container flex-right p-40' style={{alignSelf : "right"}}>
        <h2>Login</h2>
            <hr></hr>
